Askama considers all tabs, spaces, newlines and carriage returns to be whitespace. By default, it preserves all whitespace in template code, except that a single trailing newline character is suppressed. However, whitespace before and after expression and block delimiters can be suppressed by writing a minus sign directly following a start delimiter or leading into an end delimiter. Here is an example: {% if foo %} {{- bar -}}
{% else if -%} nothing
{%- endif %} This discards all whitespace inside the if/else block. If a literal (any part of the template not surrounded by {% %} or {{ }}) includes only whitespace, whitespace suppression on either side will completely suppress that literal content. If the whitespace default control is set to "suppress" and you want to preserve whitespace characters on one side of a block or of an expression, you need to use +. Example: <a href="/" {#+ #} class="something">text</a> In the above example, one whitespace character is kept between the href and the class attributes. There is a third possibility. In case you want to suppress all whitespace characters except one ("minimize"), you can use ~: {% if something ~%}
Hello
